import React from "react";
import "./App.css";
import axios from "axios";
import "./Home.css";

function Home() {
  return (
    <div className="poke-body">
      <p className="poke-text">Pokedex</p>
      <br></br>
      <p>Features:</p>
      <br></br>
      <ul>
        <li>Pokemon List Inventory</li>
        <li>Favorite your favorite Pokemon</li>
      </ul>
    </div>
  );
}
export default Home;
